protected int calculateHeight(Graphics2D g) {
        String noteText = getNoteText();

        String[] lines = noteText.split("\\R");

        int height = 0;
        for(int i=0; i < lines.length; i++) {
            height += calculateLineHeight(g, noteText);
        }
        return height  + 2 * paddingVertical;
 }
